import '../css/TodosLoading.css'

function TodosLoading() {
    return (
        <div className='LoadingTodo-container'>
            <span className='LoadingTodo-completeIcon'>
            <p className='LoadingTodo-text'>Cargando TODOs...</p>
            <span></span>
            </span>
        </div>
    )
}

export { TodosLoading }
